import{o as p,c as r,a as e}from"./index-933b924e.js";const s={class:"markdown-body"},d="2025-06-19T00:00:00.000Z",m="2025-06-19T00:00:00.000Z",i="想法",u="实习随笔",g={__name:"实习随笔",setup(n,{expose:o}){return o({frontmatter:{date:"2025-06-19T00:00:00.000Z",updated:"2025-06-19T00:00:00.000Z",category:"想法",summary:"实习随笔"}}),(l,t)=>(p(),r("div",s,t[0]||(t[0]=[e("<h2>1</h2><hr><p>第一周： 感觉很多都是在干打杂，虽然也没有期望什么，更多的是体验吧，还拿到实习证明，就OK了。</p><p>实习内容累倒是不累，但是每天通勤啊，实习第一个月没多少钱啊，一个人租房没人一起玩啊……累、不舒畅的感觉倒是来源于这些方向。</p><p>对<strong>还有作业、论文、报告没写完</strong>， 这就太痛苦了。</p><p>学习到的东西呢：</p><ul><li>公司里的分工、交流都太细、太完善了，好难看清全局</li><li>mentor 一直 是有dll 库， 有开源包可以用吗</li><li>“你先写好一个小 demo 展示”</li><li>还行，现阶段还比较简单，对我来说能实现</li></ul><p>具体的点（详细只是记录文档写在其他文章了）</p><hr><p><strong>WPF 架构</strong></p><p><strong>dll 动态链接库的调用</strong></p><p><strong>adb</strong></p><hr><h2>2</h2><p>又是周五，晚上在阳台吹吹风，看看落日。还挺不错</p><p>这周基于 WPF 框架 的 MVVM 模式写了控制手机的 adb 工具，并做了可视化，等向下周向 mentor， 展示、优化后偷来丢在 GitHub 的仓库里吧。</p><p>mentor 是不是有毛病啊，代码还没给我看，架构没给我看，测试代码没给我看，就给了测试的功能设计说明，叫我设计测试功能的日志记录抽象设计，真就抽象设计，哈哈哈，就记录， 功能参数，返回内容，三点抽象，结束。</p><p>chat 快快加油吧 ，高级算法的作业快帮我做完🥺 。</p><p>写完高级算法作业就可以暂时 好好休息一下喽！</p>",19)])))}};export{i as category,d as date,g as default,u as summary,m as updated};
